import React from "react";
import { useEffect } from "react";
import { useSelector } from "react-redux";

const Users = () => {
  const { users } = useSelector((state) => state);
  console.log("USERSSSSS", users);

  return (
    <div>
      {users.map((user, index) => {
        return (
          <div>
            <h1>user.name</h1>
            <h1>user.lastname</h1>\
          </div>
        );
      })}
    </div>
  );
};

export default Users;
